Всем привет. Коллеги, есть огненная :fire: вакансия в <http://Tinkoff.ru|Tinkoff.ru>, требуется Data Engineer / Data Scientist. Город Москва. 
* Официальное оформление согласно ТК РФ + соц. пакет (ДМС, спорт и другие плюшки)

*Содержание работы*:
* Работать с сырыми данными, в которых отражены все рекламные активности <http://Tinkoff.ru|Tinkoff.ru>;
* Создавать и внедрять интеллектуальные алгоритмы покупки рекламы на биржах;
* Разрабатывать витрины данных для их отображения в BI интерфейсах;
* Взаимодействовать с продуктовыми аналитиками;
* Сегментировать интернет аудиторию; 

*Требования к кандидатам*:
* Владеете знаниями математической статистики и очень хорошо понимаете особенности A/B и др. видов тестирования;
* Вы можете ответить на вопросы не только о нейронных сетях но и о классической линейной регрессии;
* Имеете опыт работы с R или Python от одного года;
* Обладаете хорошими знаниями unix систем - все ваши действия будут требовать уверенных навыков работы в unix окружении.
* Имеете опыт работы со стеком технологий Cloudera Hadoop от 1 года, в особенности с Hue и Oozie;

<https://hh.ru/vacancy/23045550>

Рекомендации по оформлению вакансий:
-название вакансии;
-город
-описание того что нужно делать;
-требования к кандидатам;
-вилка зарплат (от и до)
